    public function getStaffMemberIDCardStats()
    {
        $staffMemberDetails = StaffMember::select('department_name', 'id_card_file_name')
            ->groupBy('department_name')
            ->get();

        $data = [];
        foreach ($staffMemberDetails as $staffMemberDetail) {
            $data[] = [
                'department_name' => $staffMemberDetail->department_name,
                'number_of_those_where_id_card_file_name_is_null' => $staffMemberDetail->whereNull('id_card_file_name')->count(),
                'number_of_those_where_id_card_file_name_is_not_null' => $staffMemberDetail->whereNotNull('id_card_file_name')->count(),
            ];
        }

        return $data;
    }

