    public function emailAdding()
    {
        $staff_members = StaffMember::all();

        $departments = Department::all();

//        dd($departments->where('name', 'FINANCE- MANAGEMENT ')->first());

        foreach($staff_members as $staff_member){
            $department = $departments->where('name', $staff_member->department_name)->first();
            DB::table('staff_member_details')
                ->where('staff_ara_id', $staff_member->staff_ara_id)
                ->update([
                'email' => $staff_member->email,
                    'department_id' => $department->id
            ]);
        }

        echo 'done';
    }

