            $staffAraId = substr($staff['staff_id'], 3);
            $employmentCategory = empty($staff['employment_category']) ? 'full staff' : $staff['employment_category'];

            $staffMember = StaffMember::where('staff_id', $staff['staff_id'])->first();

            if ($staffMember) {
                // Update existing record
                $staffMember->updated_at = Carbon::now();
                $staffMember->save();
            } else {
                // Add new record
                $newStaff = StaffMember::create([
                    'staff_id' => $staff['staff_id'],
                    'staff_ara_id' => $staffAraId,
                    'surname' => $staff['surname'],
                    'other_names' => $staff['other_names'],
                    'department_name' => $staff['department'],
                    'job_title' => $staff['job_title'],
                    'employment_category' => $employmentCategory,
                    'created_at' => Carbon::now(),
                    'updated_at' => Carbon::now()
                ]);
                $newlyAddedStaff[] = $newStaff;
            }
